import React from "react";
import {Link} from "react-router-dom";

import './App.css'
const Nav = ()=>{
return(
    <div className="navbar"> 
       <div className="container">
       <ul>
       <a href = '#' className="logo">Logo</a>
       </ul>
<ul><Link to = "/Home" className="logo-1">Home</Link></ul>
    <ul><Link to = "/About" className="logo-2">About</Link></ul>
    </div>
    </div>
);
};
export default Nav;
